mapper.delete:

delete from spring_resource_role
where id = #{id,jdbcType=VARCHAR}
  and module_id = #{moduleId,jdbcType=VARCHAR}
  and role_id = #{roleId,jdbcType=VARCHAR}

mapper.update:

update spring_resource_role
set created_user_id = #{createdUserId,jdbcType=VARCHAR},
  created_by = #{createdBy,jdbcType=VARCHAR},
  created_on = #{createdOn,jdbcType=TIMESTAMP},
  created_ip = #{createdIp,jdbcType=VARCHAR},
  updated_user_id = #{updatedUserId,jdbcType=VARCHAR},
  updated_by = #{updatedBy,jdbcType=VARCHAR},
  updated_on = #{updatedOn,jdbcType=TIMESTAMP},
  updated_ip = #{updatedIp,jdbcType=VARCHAR}
where id = #{id,jdbcType=VARCHAR}
  and module_id = #{moduleId,jdbcType=VARCHAR}
  and role_id = #{roleId,jdbcType=VARCHAR}

mapper.select:

select id, module_id, role_id, created_user_id, created_by, created_on, created_ip, 
updated_user_id, updated_by, updated_on, updated_ip
from spring_resource_role
where id = #{id,jdbcType=VARCHAR}
  and module_id = #{moduleId,jdbcType=VARCHAR}
  and role_id = #{roleId,jdbcType=VARCHAR}
